var orderSummaryViewModel=function(n){function i(n,t){var i=t?"-":"";return i+"$"+n.toFixed(2)}var t=this;t.merchandiseSubtotal=ko.computed(function(){return i(n.summary().ItemSubtotal)});t.actualShippingPrice=ko.computed(function(){var t=n.summary().ShippingRate;return t===0?"$0.00 (Free)":i(t)});t.defaultShippingPrice=ko.computed(function(){return i(n.summary().ShippingOriginalRate)});t.promoDiscount=ko.computed(function(){return i(n.summary().TotalPromoAmountAllItems,!0)});t.purchasedGiftCardDiscount=ko.computed(function(){return i(n.summary().PurchasedGiftCardAmount,!0)});t.nonPurchasedGiftCardDiscount=ko.computed(function(){return i(n.summary().NonPurchasedGiftCardAmount,!0)});t.taxAmount=ko.computed(function(){return i(n.summary().Tax.Amount)});t.total=ko.computed(function(){return i(n.summary().Total)});t.taxType=ko.computed(function(){switch(n.summary().Tax.Type){case 2:return"Duties & Taxes:";default:return"Sales Tax:"}});t.showOriginalShippingPrice=ko.computed(function(){return n.summary().ShippingOriginalRate>0});t.showDiscountShippingPrice=ko.computed(function(){return n.summary().ShippingOriginalRate!==n.summary().ShippingRate||n.summary().ShippingOriginalRate<=0});t.showPromoDiscount=ko.computed(function(){return n.summary().TotalPromoAmountAllItems>0});t.showPurchasedGiftCardDiscount=ko.computed(function(){return n.summary().PurchasedGiftCardAmount>0});t.showNonPurchasedGiftCardDiscount=ko.computed(function(){return n.summary().NonPurchasedGiftCardAmount>0});t.showTaxAmount=ko.computed(function(){return n.summary().Tax.Amount>0});t.init=function(){registerToolTip($(".ordersummary-shippingtooltip-img"))};t.init()}